    const followerList = [{ nickName: 'namhyeon1' }, { nickName: 'namhyeon2' }, { nickName: 'namhyeon3' }]
    const followingList = [{ nickName: 'namhyeon1' }, { nickName: 'namhyeon2' }, { nickName: 'namhyeon3' }]

    return (
        <>
            <Head>
                <title>My profile | NodeBird</title>
            </Head>
            <NicknameEditForm />
            <FollowList header="following list" data={followingList }/>
            <FollowList header="follow list" data={ followerList}/>
        </>
    );
};

export default Profile;
